@Master916_21 No, un over50 senza SGP può solo prendere un aereo o una nave per la Sardegna.
Al porto e/o aeroporto NON può arrivare con un mezzo pubblico senza SGP.
Unica possibilità: mezzo proprio, passaggio, taxi o NCC.

@LauraMarongiu95 @IoeteT Dal 19-2-2022 è sufficiente un tampone negativo (antigenico o molecolare) che dura per 48h.
Quindi se il viaggio dura tra andata e ritorno meno di 48h, basta un tampone; altrimenti bisogna farne un 2º per il ritorno.
È chiaro che non è il max ma è meglio del ⛔️ divieto totale ⛔️

