Questo comporterà sia che i pazienti non avranno più l'opportunità di far parte di studi clinici ad alto tasso di innovazione, sia che depaupereremo strutture di ricerca,ospedali e personale.
Tutto questo non deve accadere.
@FADOIOfficial @afiscientifica @SIFfarmacologia @GIDMCRC

Non c'è più tempo.
L'#Italia corre il rischio di perdere la possibilità di continuare a fare #ricerca, in un settore così strategico per noi. Se si continua a temporeggiare,la sperimentazione clinica,come sta già accadendo, non verrà più svolta nel nostro #Paese.
@FarmindustriaTW

Comprendo le difficoltà che il @MinisteroSalute sta attraversando in questi mesi così convulsi, ma non possiamo ignorare il grido d'allarme del mondo della ricerca e @ConFOCE.
Il #Governo promulghi i decreti attuativi sulla #sperimentazioneclinica.
@Deputatipd
